  \"2013-03-14T19:24:58.409832\",\n\t\"name\": \"hydrography-streams-and-shorelines\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The hydrography layer consists of flowing
  waters (rivers and streams), standing waters (lakes and ponds), and wetlands --
  both natural and manmade. Two separate feature types are represented: polygons (areas)
  and lines. Polygon features have attribute codes that identify water bodies such
  as lakes, wide river segments, or swamps. Line features have attribute codes that
  represent streams or shorelines.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
